    "    * **Limit** or **remove** notifications from the hours of 8pm to 5am, as these were the hours of least activity for users, suggesting rest and sleep time.\n",
    "    * As half of the users had satisfactory or poor sleeping habits, Bellabeat has the opportunity to **educate their users** about the **importance of sleep** to their health. By sending out marketing emails, quick bite-sized notifications via app or tracker, or doing both, this would keep users intrigued, engaged and educated. Having the ability to customize a users sleep notifications so they can set their waking/sleeping times, would also greatly affect their habits.\n",
